import React, { useState, useEffect } from "react";
import { gql, useMutation, useLazyQuery } from "@apollo/client";

export default function Home() {
const [functionToRender,setfunctionToRender]=useState("");
  function Funct(prop){
    console.log(prop,"prop")
    return (
        <>
        <div>
          <p>Name:{prop.data.dato.name}</p>
          <p>Description:{prop.data.dato.Description}</p>
          <p>Info:{prop.dato.info}</p>
          <p>father{prop.dato.father}</p>
        </div>
        </>
    )

  }


  const DATO = gql`
  query dato($id: String) {
    dato(id: $id) {
      name
      info
      Description
      father
    }
  }
`;

const [getFields, { loading, data }] = useLazyQuery(DATO);
useEffect(() => {

if(data){setfunctionToRender(<Funct data={data}/>)}
  // return () => {
  //   cleanup
  // }
}, [data])



return(
<>
<div>
  {functionToRender}
<input type="button" onClick={()=>getFields({ variables: { id: "36" } })} value="Javascript"></input>

</div>
</>

)



}
